import React from "react";
import "./index.scss";

const MotivatingFactors = ({ texts }) => {
    return (
        <div className="motivating-factors-noAuth">
            <h2>Fatores motivadores</h2>
            <p className="desc-profiler">{texts.fatores_motivadores.texto}</p>
        </div>
    );
};

export default MotivatingFactors;
